import React from "react";
import ReactDOM from "react-dom/client";
function App() {
  return (
    <div style={{ border: "2px solid aqua" }}>
      <p>Login</p>
    </div>
  );
}
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

